import React from 'react';
import './Popup.css'

function Signup(props) {
    return (props.trigge) ? (
        <div className="popup">
            <div className="popup-inner">
                <button className="close-btn" onClick={() => props.setTrigger(false)}>
                    Close
                </button>
                {props.children}
            </div>
        </div>
    ) : "";
}

export default Signup;
